export const getWeather = async (data) => {

    const params = {
      appid: API_KEY,
      lang: 'it',
      units: 'metric',
      lat: data.lat,
      lon: data.long
    };

    // return obj
    return await axios.get(ENDPOINT_WEATHER, { params }).then(res => {
      return res.data
    })
}

